import React from 'react';
import { Tabs } from 'antd';
import StyledTitle from './Titles';

const { TabPane } = Tabs;

const PortpolioList = () => {
  return (
    <div>
      <StyledTitle style={{ marginBottom: '0px' }}>
        <span>Portpolio List ✨</span>
      </StyledTitle>
      <Tabs defaultActiveKey='1' centered>
        <TabPane tab='Front-end(2)' key='1'></TabPane>
        <TabPane tab='Publishing()' key='2'></TabPane>
      </Tabs>
    </div>
  );
};

export default PortpolioList;
